import React from 'react'

export default function About() {
  return (
    <>
    <div className="" style={{width:"100%",height:"380px",backgroundColor:"grey",marginTop:"50px",display:"flex"}}>
      <div className="" style={{width:"50%",height:"100%",backgroundColor:"black"}}></div>
      <div className="" style={{width:"50%",height:"100%",backgroundColor:"grey",padding:"10px,10px,10px,10px"}}>
        <p>We are a team of passionate agricultural scientists, AI engineers, and data analysts committed to transforming the agricultural industry through innovative technology. Our mission is to empower farmers and agricultural businesses with cutting-edge tools to improve crop health, increase yield, and promote sustainable farming practices.</p>
      </div>
    </div>
    </>
    
  )
}
